const folder = './logs/';
const fs = require('fs');
let list = [];

fs.readdirSync(folder).forEach(file => {
  list.push(file)
});
list = list.toString().split(',').join('\n');
this.storeValue(list, 1, "list", cache);
Actions.callNextAction(cache);

